import React, { Component } from 'react'

export class Audi extends Component {
    render() {
        return (
            <div>
                <div className="container mt-5 pt-5">
                    <div className="row">   
                        <img className="col-lg-3 img-show-side" src="\Images\Logos\cmp\audi.png" /><div className="col-lg-9">Mercedes</div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Audi
